import react from 'react';
import bloglistStyles from './blogslist.module.scss'

const BlogsList = (props) => {
    return (
        <react.Fragment>
            {/* {props.data.map((item, idx) => { */}
            {props.posts.map((item, idx) => {
                item = item.fields;
                let dummyText = item.text.content[2].content[0].value;
                return (
                    <div key={idx} className={bloglistStyles.blogItem}>
                        <a href="#">
                            <p className={bloglistStyles.title}>{item.title}</p>
                        </a>

                        <p className={bloglistStyles.author}>Author: <span className={bloglistStyles.name}>{item.author}</span></p>
                        <p className={bloglistStyles.date}>Published on: {item.date}</p>
                        <p className={bloglistStyles.text}>{dummyText}... <span className={bloglistStyles.readmore}><a href="#">READ MORE</a></span></p>
                    </div>
                )
            })}
        </react.Fragment>
    )
}

export default BlogsList;
